import React from "react";

function App() {
  return (
    <details className="m-4 p-4 border rounded bg-blue-100 w-2/6 duration-150 bg-stone-700 text-white cursor-pointer group">
      <summary className="list-none flex justify-between items-center">
        What can I watch on Netflix?
        <svg viewBox="0 0 26 26" width={25} className="fill-white">
          <g>
            <path d="M10.5 9.3L1.8 0.5 0.5 1.8 9.3 10.5 0.5 19.3 1.8 20.5 10.5 11.8 19.3 20.5 20.5 19.3 11.8 10.5 20.5 1.8 19.3 0.5 10.5 9.3Z"></path>
          </g>
        </svg>
        {/* <div className="border-8 border-transparent border-l-white group-open:rotate-90 transition delay-75"></div> */}
      </summary>
      <p>
        Netflix has an extensive library of feature films, documentaries, TV
        programmes, anime, award-winning Netflix originals and more. Watch as
        much as you want, anytime you want. <br />
        <br />
        <a href="">Check out some of our content</a>.
      </p>
    </details>
  );
}

export default App;
